# 给定一个二进制数组，计算其中最大连续1的个数

# 遍历数组，更新maxnums
def findMaxConsecutiveOnes(nums) -> int:
        # 定义变量存储当前的最大的连续1的个数
    maxNumber = 0
    tempNumber = 0
    for i in range(len(nums)):
        if nums[i] == 1:
            tempNumber += 1
        else:
            maxNumber = max(tempNumber,maxNumber)
            tempNumber = 0
        
    return max(tempNumber,maxNumber)


print(findMaxConsecutiveOnes([1,1,0,1,1,1]))


# 双指针？慢指针指向连续1的开头；快指针指向连续1的结尾；
# 当快指针指向0时,让慢指针指向该位置的下一位置,不断重复
def anotherSolution(nums):
    maxNumber = 0
    i = 0
    for i in range(len(nums)):
        j = i
        while j<len(nums) and nums[j]==1:
            j+=1
        # 跳出while循环时,j已经指向0
        maxNumber = max(maxNumber,(j-i))
        i = j
    
    return maxNumber

